(async()=>{const e=await(await fetch("https://qwarry.ilucca.net/api/v3/users/scope?appInstanceId=5&operations=1&paging=0,1000&fields=name,picture[id]")).json(),t=[];e.data.items.forEach(e=>{e.picture&&t.push({name:e.name,pictureId:e.picture.id})}),setInterval(()=>{!function(){try{const a=document.querySelector("app-game app-timer div.image").style.getPropertyValue("background-image");document.querySelectorAll("app-game .answers.buttons button").forEach(e=>{t.forEach(t=>{new RegExp(t.pictureId).test(a)&&new RegExp(t.name.replace(" ",".*"),"i").test(e.innerText)&&e.click()})})}catch(e){}}()},10)})();
